import React, { Component } from 'react'

class BackEnd extends Component {

    constructor(props){
        super(props)

        this.state = {apiResponse : "" }
    }

    callAPI(){
        fetch("http://localhost:8080/test")
    }

    componentDidMount(){
        this.callAPI
    }



    render(){
        return (
            <div>
                <h1>This BackEnd</h1>
                <span>{this.callAPI}</span>
            </div>
        )
    }

}

export default BackEnd;
